import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import ItemDetail from "../detailComponents/ItemDetailComponent/ItemDetailComponent"
import axios from "axios";

const ItemDetailSreen = () => {

    const [listItemDetails,setListDetail] = useState([]);

    useEffect(() => {
        axios.get("/bag")
             .then(res => {
                 setListDetail(res.data)
             })
             .catch(err => console.log(err))
    },[60])

    return(
        <div>
            {
                listItemDetails.length !== 0 ? (<ItemDetail listItemDetails={listItemDetails}/>) : <ItemDetail />
            }
        </div>
    )
}

export default ItemDetailSreen;
